// import '../imports/utils'
import { Meteor } from 'meteor/meteor';
import { Players } from '../imports/api/players';

class Person {
  constructor(name = 'JhonD', age = 0) {
    this.name = name;
    this.age = age;
  }
  getGreeting() {
    return `Hi I am ${this.name}`;
  }
  getPersonDescription() {
    return `Person with name ${this.name}, and he is ${this.age} years old`
  }
}

Meteor.startup(() => {
  let me = new Person('Mika', 25);
  console.log(me.getGreeting());
});
